column8:
人気のレインコートポンチョタイプです。自転車用（ママチャリ用）となります。メンズ レディース両対応です。男用 女用です。中学生や高校生、大学生の男の子 女の子の通勤に。学生にぴったりです。お父さんの通勤にも最適。 雨の日にもkappaがあれば濡れるストレスがありません。フード付きraincoatで梅雨もへっちゃら。レインブーツ・レインシューズと合わせれば上下濡れずに済みます。<br>
日本で日本人による全数検品を行っております。日本製の品質に少しでも近づけるよう努力しております。
<br><br>
<br>
クロシェ　自転車用レインコート　ポンチョタイプ<br>
自転車用雨具が期間限定でこの価格です！

